import './App.css';
import { Menu, RightSection } from './Components';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
    return (
        <Router>
            <Menu />
            <Route path="/attendance" component={Attendance} />
            <Route path="/leave" component={Leave} />
            {/* Other routes here */}
        </Router>
    );
}

function Leave() {
  // Leave page logic here
  return (
      // Leave page JSX here
      <div className="App">
      <Menu />
    </div>
  );
}


function Attendance() {
  return (
    <div className="App">
      <Menu />
      <RightSection/>
    </div>
  );
}

export default Attendance;
